import logo from '../../logo.svg';
import './App.css';
import React, { Component } from 'react';
import UpperNav from "../../../../../../mensa-app-gruppe-04/munchin/src/components/UpperNav/UpperNav";
import Home from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Home/Home";
import MensaLogged from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Mensa/MensaLogged";
import Speiseplan from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Mensa/Speiseplan";
import Nutzereinstellung
  from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Nutzereinstellung/Nutzereinstellung";
import Info from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Info/Info";
import Profil from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Profil/Profil";
import Favoriten from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Favoriten/Favoriten";
import Faq from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Faq/Faq";
import Feedback from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Feedback/Feedback";
import Sprache from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Sprache/Sprache";
import Payment from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Payment/Payment";
import Navbar from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Navbar/Navbar";
import Mensa from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Mensa/Mensa";
import Login from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Login/Login";
import Registrieren from "../../../../../../mensa-app-gruppe-04/munchin/src/components/Registrieren/Registrieren";

class App extends Component {
  constructor(){
    super();
  }

  App() {
    return (
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
              Jo test
              Edit <code>src/App.js</code> and save to reload.
            </p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
              Learn React
            </a>
          </header>
        </div>
    );
  }

  render(){
    //Logged In
    if(this.state.user !== null){
      return(
          <Router>
            <UpperNav />
            <div className="routeDiv">
              <Route path="/home" component={Home} />
              <Route path="/mensen" component={MensaLogged} />
              <Route path="/speiseplan" component={Speiseplan}/>
              <Route path="/nutzereinstellung" component={Nutzereinstellung} />


              <Route path="/info" component={Info} />
              <Route path="/profil" render={props => (<Profil {...props} userEmail={this.state.email} userName={this.state.benutzerName}/>)}/>
              <Route path="/favoriten" component={Favoriten} />
              <Route path="/faq" component={Faq} />
              <Route path="/feedback" component={Feedback} />
              <Route path="/language" component={Sprache} />
              <Route path="/payment" component={Payment} />

            </div>

            <Navbar userEmail={this.state.email} userName={this.state.benutzerName}/>
          </Router>
      )
      //Logged Out
    } else {
      return(
          <Router>
            <UpperNav />
            <Route path="/home" component={Home} />
            <Route path="/mensen" component={Mensa} />
            <Route path="/speiseplan" component={Speiseplan}/>
            <Route path="/login" component={Login} />
            <Route path="/registrieren" render={props => (<Registrieren {...props} loginHandler={this.loginHandler}/>)} />
            <Route path="/info" component={Info} />
            <Route path="/language" component={Sprache} />
            <Navbar />
          </Router>
      )
    }
  }
}

export default App;
